import { useEffect, useState } from "react";
import { getAllUsers } from "../../api/peopleApi";
import { Link } from "react-router-dom";

function PeopleList() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    getAllUsers().then(setUsers);
  }, []);

  return (
    <div>
      <h2>People Management</h2>

      <div style={{ marginBottom: 20 }}>
        <Link to="/people/add"><button>Add User</button></Link>{" "}
        <Link to="/people/promote"><button>Promote</button></Link>{" "}
        <Link to="/people/schedule"><button>Schedule</button></Link>{" "}
        <Link to="/people/availability"><button>Availability</button></Link>
      </div>

      <table border="1" width="100%">
        <thead>
          <tr>
            <th>ID</th>
            <th>Full Name</th>
            <th>Salary / Hour</th>
          </tr>
        </thead>
        <tbody>
          {users.map(u => (
            <tr key={u.id}>
              <td>{u.id}</td>
              <td>{u.fullName}</td>
              <td>{u.salaryPerHour}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default PeopleList;
